import React from 'react';
import './ModelsCard.css';

const ModelsCard = ({ model, isActive, onSelect }) => {
  return (
    <div className={`card ${isActive ? 'active' : ''}`} onClick={onSelect}>
      <h3>{model.name}</h3>
      <p>SKU: {model.sku}</p>
      <p>{model.description}</p>
    </div>
  );
};

export default ModelsCard;
